def image_to_blob(image_path):
    """
    Convert an image to a blob
    """
    with open(image_path, "rb") as image_file:
        image_data = image_file.read()
        image_data_base64 = base64.b64encode(image_data).decode("utf-8")
        return image_data_base64
        
